import React from "react";
import './Ideases.css'
import Ideas from "./Ideas";

class Ideases extends React.Component{
    constructor(props) {
        super(props);
        this.array = ["GGG"];
    }

    render() {
        return (
            <div className={"ideas"}>
                {
                    this.array.map((item)=>{
                        return (
                            <Ideas/>
                        )
                    })
                }
            </div>
        );
    }
}
export default Ideases;
